import './AdminPage.css';
import { useNavigate, Link  } from 'react-router-dom';
import axios from 'axios'; // Import Axios
import Dropdown from 'react-bootstrap/Dropdown';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import { Container, ListGroup } from 'react-bootstrap'; 



const SideBar = () => {
    return(
        <div className="sidebar">
            <ul>




                <ListGroup>
                    <ListGroup.Item as={Link} to="*/create-user"><span>Create User</span></ListGroup.Item>
                    <ListGroup.Item as={Link} to="*/create-project"><span>Create Project</span></ListGroup.Item>
                    <ListGroup.Item variant="success">Item 3</ListGroup.Item>
                    <Dropdown >
                        <Dropdown.Toggle as={Link} to="*/users" variant="success" id="dropdown-basic" className="btn btn-success">
                            <span className='title'>List Users</span>
                        </Dropdown.Toggle>

                        <Dropdown.Menu >
                            <Dropdown.Item href="#/action-1">Action 1</Dropdown.Item>
                            <Dropdown.Item href="#/action-2">Action 2</Dropdown.Item>
                            <Dropdown.Item href="#/action-3">Action 3</Dropdown.Item>
                        </Dropdown.Menu>
                    </Dropdown>
                {/* Add more ListGroup.Items as needed */}
                </ListGroup>
                <li ><a><span className='title'>Menu Item 1</span></a></li>



            </ul>

        </div>
    )
}

export default SideBar;
